INSERT INTO `simple_questions` (`id`, `code`, `title`, `created`, `status`, `question_type`, `company_id`) VALUES
(1, ' 1', 'Насколько Вы удовлетворены качеством опросов, которые Вы получаете в ходе своей деятельности?', '2018-04-05 06:27:38', 0, NULL, 1),
(2, ' 2', 'Оцените пожалуйста по 10-и бальной шкале, насколько вероятно то, что Вы порекомендуете своим друзьям или близким пройти подобный опрос?', '2018-04-05 06:28:00', 0, NULL, 1),
(3, ' 3', 'Каким способом Вам удобней отвечать на опросы?', '2018-04-05 06:28:00', 0, NULL, 1),
(4, ' 4', 'Как часто Вы получаете подобные опросы?', '2018-04-05 06:28:00', 0, NULL, 1),
(5, '5', 'Какое количество времени Вы готовы выделить на подобный опрос?', '2018-04-05 06:28:00', 0, NULL, 1),
(6, '6', 'Опишите пожалуйста свои впечатления от опроса, легко ли было Вам отвечать на него, хотите ли что-нибудь посоветовать нам для улучшения сервиса опроса…', '2018-04-05 06:28:00', 0, NULL, 1),
(7, ' 1', 'Оцените скорость предоставления кредита?', '2018-04-05 09:26:29', 0, NULL, 2),
(8, ' 2', 'Основываясь на опыте оформления кредита, порекомендуете ли Вы Евразийский банк своим знакомым и друзьям? Ответьте по шкале от 0 до 10, где 10 - точно порекомендую, 0 - точно не порекомендую.', '2018-04-06 04:29:31', 0, NULL, 2),
